INSERT INTO `posts` (`post_id`, `cat_id`, `post_title`, `post_date`, `post_author`, `post_keyword`, `post_image`, `post_content`) VALUES
(3, 2, 'Citizen Journalism', '10-20-14', 'Admin', 'Citizen Journalism', 'city_jurnalism.jpg', '<p style="font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify; text-indent: 30px;">Citizen journalism merupakan sebuah kegiatan yang tidak asing dalam dunia penyiaran, pada dasarnya Citizen Journalism merupakan kegiatan partisipasi aktif yang dilakukan oleh masyarakat dalam kegiatan pengumpulan, pelaporan, analisis serta penyampaian informasi dan berita. Tipe jurnalisme seperti ini akan menjadi paradigma dan tren baru tentang bagaimana pembaca atau pemirsa membentuk informasi dan berita pada masa mendatang.</p>\r\n<p style="font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify; text-indent: 30px;">Melihat perkembangan yang begitu pesat dari dunia penyiaran, Indonesia Broadcastign Expo mengadakan sebuah kontes Citizen Journalism. Kontes ini diadakan untuk menampung dan mengapresiasi begitu banyak bakat yang dimiliki oleh masyarakat Indonesia pada khususnya.</p>\r\n<p style="font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify; text-indent: 30px;">Citizen Journalism Contest ini merupakan sebuah ajang live report yang terbuka untuk umum, bagi para peserta yang ingin ikut serta dalam kontes ini harus meng-upload hasil video mereka yang berdurasi maximal 3 menit ke youtube.com. Karya yang dihasilkan harus mengangkat kegiatan Indonesia Broadcasting Expo 2014 yang akan berlangsung di Kawasan Terpadu Trasns Studio Bandung.</p>\r\n<p style="font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify; text-indent: 30px;">Berikut adalah syarat dan ketentuan untuk mengikuti Citizen Journalism Contest:</p>\r\n<ul>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Terbuka untuk umum</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Berhadiah Gadget</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Video yang di upload tidak mengandung SARA</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Tema live report yang diangkat harus berkaitan dengan IBX 2014</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Tiap peserta harus memposting video ke dalam situs youtube dengan Hastag #IBX2014</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Link dari youtube harus di cantumkan dalam website resmi IBX</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Durasi Video yang dihasilkan maksimal 3 menit</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Batas akhir pengiriman dan penyantuman link dalam website resmi IBX adalah sebelum acara penutupan IBX 2014 berlangsung</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Tiap peserta harus mengikuti aturan yang telah disepakati</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Keputusan panitia mutlak dan tidak dapat diganggu gugat</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Peserta mengirimkan link youtube beserta data diri (Nama, Jenis Kelamin, Institusi, Usia, Email,Account Sosial media [Facebook, Twitter, Instagram],Nomer telfon/HP) ke email redaksi:<a style="text-decoration: none;" href="mailto:redaksi@ibx.asia.com">redaksi@ibx.asia</a>&nbsp;dengan subject Citizen Journalism Contest</li>\r\n<li style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Batas pengumpulan video di hari Jumat, 31 Oktober 2014 Pukul 18.00 WIB</li>\r\n</ul>'),
(4, 2, 'Job Fair IBX 2014', '10-20-14', 'Admin', 'Job Fair', 'job_fair.jpg', '<ul style="font-size: 14px; font-family: Arial, Helvetica, sans-serif; text-align: justify;">Syarat &amp; Ketentuan :\r\n<li style="text-align: justify;">Register di website IBX untuk akses masuk</li>\r\n<li style="text-align: justify;">Membawa CV dalam bentuk Soft Copy max 200Kb dan Hard Copy serta dokumen pendukung</li>\r\n<li style="text-align: justify;">Bawa Pas Foto ukuran 3X4 dsn 4X6</li>\r\n<li style="text-align: justify;">Berpakaian Rapih</li>\r\n<li style="text-align: justify;">Info Lowongan dan posisi klik&nbsp;<a style="text-decoration: none;" href="http://ibx.asia/exhibitor.html" target="_blank">logo Stasiun Televisi</a>yang diinginkan</li>\r\n</ul>'),
(23, 1, 'About Indonesia Broadcasting Expo', '10-27-14', 'Admin', 'About', 'LOGO01.png', '<p>Indonesia Broadcasting Expo terlahir karena media memiliki peran yang sangat besar dalam mencerdaskan kehidupan berbangsa dan bernegara. Selain itu industri penyiaran Indonesia berkembang sangat pesat yang ditandai dengan diaplikasikannya teknologi media sosial yang berimbas pada gaya hidup dan perilaku masyarakat dalam menerima informasi. Menanggapi pesatnya perkembangan industri penyiaran yang sangat pesat diperlukan penyikapan dan penyiapan untuk menyambut perkembangan industri baik dari sisi SDM, tekhnologi, konten siaran, maupun kematangan masyarakat.</p>\r\n<p>Indonesia Broadcasting Expo mengkolaborasikan beberapa acara seperti, seminar, workshop, bursa kerja dan hiburan terkait dunia penyiaran Indonesia. Ajang ini juga sebagai tempat untuk mempertemukan seluruh stakeholder penyiaran. Konsep pagelaran Indonesia Broadcasting Expo secara keseluuhan akan menggabungkan kearifan lokal dan perkembangan teknologi terkini dengan tetap mempertahankan identitas kebangsaan yaitu Bhinneka Tunggal Ika.</p>\r\n<p>Acara ini bertujuan untuk memberikan gambaran kepada masyarakat tentang perkembangan industri penyiaran di Indonesia, Menjadi ajang pertukaran informasi, pengetahuan dan pengalaman dengan mengundang pelaku industri penyiaran daerah, nasional dan macanegara, sebagai momentum antar pemangku kepentingan penyiaran yang sehat dan sebagai agenda tahunan yang dimaksudkan sebagai rujukan utama bagi pemangku kepentingan penyiaran dalam mengikuti perkembangan dunia penyiaran Indonesia.</p>'),
(15, 2, 'OB Van Radio', '10-27-14', 'Admin', 'Ob Van Radio', 'obi_van.jpg', '<p>Sebelum masuk dalam agenda utama, Indonesia Broadcasting Expo yang akan diselenggarakan di Bandung akan bekerjasama sama dengan radio-radio lokal. Tujuannya adalah untuk mensosialisasikan Event Indonesia Broadcasting Expo agar lebih banyak orang yang mengetahui akan event ini.</p>\r\n<p>Pre-event yang rencananya akan berlangsung mulai dari tanggal 25 &ndash; 26 Oktober ini akan memberikan banyak informasi dan hiburan bagi kalian warga Bandung dan sekitarnya. Dalam OB Van Carnaval ini kalian bisa tau apa aja seputar IBX, mulai dari Kegiatan Acara, Pengisi Acara, Jadwal Seminar dan Workshop dan masih banyak lainnya.</p>\r\n<p>Jadi, kalian jangan sampai lewatkan kegiatan ini.. untuk mengetahui lokasi berlangsungnya acara ini, kalian bisa dengerin terus radio kesukaan anda. Jangan sampai terlewatkan Indonesia Broadcasting Expo 2014.</p>'),
(16, 2, 'Forum Asean Community', '10-27-14', 'admin', 'Forum Asean community', 'forum_asean.jpg', '<p>Forum asean Community</p>'),
